choices.text:
if (step.getWait()) {
    if (item instanceof Job) {
        LOGGER.log(Level.FINE, "Waiting for job {0}", item.getFullName());
    } else if (item instanceof Queue.Task) {
        LOGGER.log(Level.FINE, "Waiting for task {0}", item.getFullName());
    } else {
        throw new AbortException("Waiting for non-job items is not supported");
    }
}
/* FIXED: */
if (!(item instanceof Job) && !(item instanceof Queue.Task)) {
    if (step.getWait()) {
        throw new AbortException("Waiting for non-job items is not supported");
    }

